import React from "react";
import Cookies from "js-cookie";
import "./dropdown.css"

const Dropdown = () => {

    const firstName = Cookies.get('firstName');

    return (
        <div className="dropdown-container">
            <ul className="dropdown-menu">
                <li></li>
                <li className="dropdown-item">Profile</li>
                <li className="dropdown-item">Account Settings</li>
                <li className="dropdown-item">Reciept Settings</li>
                <li className="dropdown-item"><i class="fa-solid fa-right-from-bracket">Logout</i></li>
            </ul>
        </div>
    )

}

export default Dropdown;
